import React, { useEffect, useRef, useState } from 'react';
import { ArrowRight, ClipboardList, Code, Palette, Rocket, CheckCircle } from 'lucide-react';

interface ServicesProps {
  scrollToContact: () => void;
}

const Services: React.FC<ServicesProps> = ({ scrollToContact }) => {
  const [isVisible, setIsVisible] = useState(false);
  const sectionRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsVisible(true);
          observer.unobserve(entry.target);
        }
      },
      { threshold: 0.2 }
    );

    if (sectionRef.current) {
      observer.observe(sectionRef.current);
    }

    return () => {
      if (sectionRef.current) {
        observer.unobserve(sectionRef.current);
      }
    };
  }, []);

  const processSteps = [
    {
      icon: <ClipboardList size={40} className="text-purple-400 group-hover:text-white transition-colors duration-300" />,
      title: 'Planning',
      description: 'We analyze your requirements and create a detailed roadmap for your project.',
    },
    {
      icon: <Palette size={40} className="text-purple-400 group-hover:text-white transition-colors duration-300" />,
      title: 'Design',
      description: 'Our designers create intuitive and visually stunning interfaces that align with your brand.',
    },
    {
      icon: <Code size={40} className="text-purple-400 group-hover:text-white transition-colors duration-300" />,
      title: 'Development',
      description: 'Our developers bring the design to life with clean, efficient, and scalable code.',
    },
    {
      icon: <Rocket size={40} className="text-purple-400 group-hover:text-white transition-colors duration-300" />,
      title: 'Launch',
      description: 'We deploy your project with thorough testing and continuous monitoring.',
    },
  ];

  return (
    <section id="services" ref={sectionRef} className="py-20 relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-b from-purple-900 to-black z-0"></div>

      <div className="container mx-auto px-4 relative z-10">
        <div className={`text-center mb-16 transition-all duration-1000 ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'}`}>
          <h2 className="text-3xl md:text-4xl font-bold mb-6">
            <span className="bg-clip-text text-transparent bg-gradient-to-r from-purple-400 to-blue-400">Our Process</span>
          </h2>

          <p className="text-lg max-w-3xl mx-auto text-gray-300">
            We follow a streamlined process to ensure your project is delivered on time and exceeds expectations.
          </p>
        </div>

        <div className={`flex flex-col lg:flex-row items-center justify-center gap-8 mb-16 transition-all duration-1000 delay-300 ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'}`}>
          {processSteps.map((step, index) => (
            <React.Fragment key={index}>
              <div 
                className={`group bg-gradient-to-br from-gray-900 to-black p-0.5 rounded-xl hover:from-purple-600 hover:to-blue-600 transition-all duration-500 cursor-pointer relative ${index === processSteps.length - 1 ? 'animate-pulse' : ''}`}
                onClick={scrollToContact}
              >
                <div className="bg-black rounded-lg h-full p-6 flex flex-col relative z-10">
                  <div className="mb-4">
                    {step.icon}
                  </div>

                  <h3 className="text-xl font-bold mb-3 group-hover:bg-clip-text group-hover:text-transparent group-hover:bg-gradient-to-r group-hover:from-purple-400 group-hover:to-blue-400 transition-all duration-500">
                    {step.title}
                  </h3>

                  <p className="text-gray-400 flex-grow">
                    {step.description}
                  </p>

                  <div className="mt-4 overflow-hidden">
                    <span className="inline-block text-purple-400 group-hover:translate-x-2 transition-transform duration-300">
                      Learn more →
                    </span>
                  </div>
                </div>
                {index === processSteps.length - 1 && (
                  <div className="absolute -inset-1 bg-gradient-to-r from-purple-600 to-blue-600 rounded-xl blur opacity-75 animate-pulse -z-10"></div>
                )}
              </div>

              {index < processSteps.length - 1 && (
                <div className="hidden lg:block">
                  <ArrowRight 
                    size={40} 
                    className="text-purple-400 animate-bounce"
                    style={{ animationDuration: '2s' }}
                  />
                </div>
              )}
            </React.Fragment>
          ))}
        </div>

        <div className={`text-center transition-all duration-1000 delay-600 ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'}`}>
          <button 
            onClick={scrollToContact}
            className="px-8 py-3 rounded-full bg-white text-black hover:bg-gray-100 transform hover:scale-105 transition-all duration-300 shadow-lg hover:shadow-xl text-lg font-medium"
          >
            Start Your Project
          </button>
        </div>
      </div>
    </section>
  );
};

export default Services;
